import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Stack } from '@mui/material';
import Button from '@mui/material/Button';
import './css/style.css'


export default function TextField4() {

    const [data] = UseFetchCurrencies();

    return (
        <div>
            <TextField id="textField34" label="" variant="filled" color='primary' fullWidth />
            <Stack direction='row' className='CurrencyRow'>
                {data && data.map(
                    (currency, index) => {
                        return (
                            <Button variant="text" className='button' key={'cur2' + index}>{currency}</Button>
                        )
                    }
                )}
            </Stack>
        </div>
    )
}
